import React, { useRef, useState } from "react";
import "./EmployeeRegister.css";

export default function EmployeeRegister() {
    const [errorMessage, setErrorMessage] = useState("");
    const [successMessage, setSuccessMessage] = useState("");
    const fullNameRef = useRef();
    const emailRef = useRef();
    const passwordRef = useRef();
    const mobileRef = useRef();
    const dateRef = useRef();
    const confirmPasswordRef = useRef();
    const salaryRef = useRef();

    const handleSignupSuccess = (event) => {
        event.preventDefault();
        setErrorMessage(""); 
        setSuccessMessage("");

        const name = fullNameRef.current.value.trim();
        const email = emailRef.current.value.trim();
        const mobileNo = mobileRef.current.value.trim();
        const joiningDate = dateRef.current.value.trim();
        const password = passwordRef.current.value.trim();
        const confirmPassword = confirmPasswordRef.current.value.trim();
        const salary = parseFloat(salaryRef.current.value.trim());

        if (!name || !email || !mobileNo || !joiningDate || !password || !confirmPassword || !salary) {
            setErrorMessage("All fields are required!");
            return;
        }
        if (!/^[a-zA-Z]+(?: [a-zA-Z]+)*$/.test(name)) {
            setErrorMessage("Please enter a valid name!");
            return;
        }
        if (!/^[6-9][0-9]{9}$/.test(mobileNo)) {
            setErrorMessage("Please enter a valid mobile number!");
            return;
        }
        if (!/^([a-zA-Z0-9]+)@([a-zA-Z0-9]+)\.([a-zA-Z]{2,})(\.[a-zA-Z]{2,})?$/.test(email)) {
            setErrorMessage("Please enter a valid email!");
            return;
        }
        if (!/^(?=.*[0-9])(?=.*[a-z])(?=.*[A-Z])(?=.*[@#$])[A-Za-z0-9@#$]{6,12}$/.test(password)) {
            setErrorMessage("Password must be 6-12 characters, with at least one digit, one lowercase, one uppercase, and one special character (@, #, $)");
            return;
        }
        if (password !== confirmPassword) {
            setErrorMessage("Passwords do not match!");
            return;
        }

        const data = {
            name,
            email,
            mobileNo,
            joiningDate,
            salary,
            password,
        };

        fetch("http://localhost:8085/api/employee/addUser", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(data),
        })
            .then((response) => {
                if (!response.ok) {
                    return response.json().then((data) => {
                        throw new Error(data.error || "Failed to create employee account");
                    });
                }
                return response.json();
            })
            .then((val) => {
                setSuccessMessage("Employee account successfully created!");
                console.log("Response Data:", val);
                fullNameRef.current.value = "";
                emailRef.current.value = "";
                mobileRef.current.value = "";
                dateRef.current.value = "";
                salaryRef.current.value = "";
                passwordRef.current.value = "";
                confirmPasswordRef.current.value = "";
            })
            .catch((err) => {
                setErrorMessage(err.message);
            });
    };

    return (
        <div className="employee-register-wrapper">
            <div className="employee-register-card">
                <h2 className="form-header">Register Employee</h2>
                <form className="employee-register-form" onSubmit={handleSignupSuccess}>
                    {errorMessage && <p className="error-message">{errorMessage}</p>}
                    {successMessage && <p className="success-message">{successMessage}</p>}
                    <input className="input-field" type="text" placeholder="Full Name" ref={fullNameRef} />
                    <input className="input-field" type="email" placeholder="Email" ref={emailRef} />
                    <input className="input-field" type="tel" placeholder="Mobile Number" ref={mobileRef} />
                    <input className="input-field" type="date" placeholder="Joining Date" ref={dateRef} />
                    <input className="input-field" type="number" placeholder="Salary" ref={salaryRef} min="0" />
                    <input className="input-field" type="password" placeholder="Password" ref={passwordRef} />
                    <input className="input-field" type="password" placeholder="Confirm Password" ref={confirmPasswordRef} />
                    <button type="submit" className="submit-btn">Create Employee</button>
                </form>
            </div>
        </div>
    );
}
